import { ADD_FETCHED_DATA } from './usersActiontypes';

export const fetchData = () => {
  return (dispatch) => {
      return api.get('/v1/users')
          .then(response => {
              return response.data
          })
          .then(data => {
              dispatch({
                  type: ADD_FETCHED_DATA,
                  payload: data
              })
          })
          .catch(error => {
              throw (error);
          });
  };
};
